import React, { useState } from "react";
import { MDBContainer, MDBInput, MDBRow, MDBCol } from "mdb-react-ui-kit";

import TextField from "@mui/material/TextField";
import Autocomplete from "@mui/material/Autocomplete";

import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import Select, { SelectChangeEvent } from "@mui/material/Select";
import FormHelperText from "@mui/material/FormHelperText";

function Adressdaten(props) {
  return (
    <>
      <h5 className="mb-4">Adressdaten</h5>

      <h6>Versender</h6>
      <MDBRow >
        <MDBCol >
          <TextField className="me-3 mb-3"
          sx={{ minWidth: 250, maxWidth: 250 }}
            id="eoriVersender"
            name="eoriVersender"
            label="EORI-Nummer*"
            variant="outlined"
            disabled
            value={props.fieldValue.eoriVersender}

            error={
              props.inputMissingError.eoriVersender ||
              props.inputWrongError.eoriVersender
            }
            helperText={
              props.inputMissingError.eoriVersender
                ? "Pflichtfeld"
                : props.inputWrongError.eoriVersender
                ? "Zahl eingeben"
                : null
            }
            onChange={(event) => props.handleNumberFieldChange(event)}
          />

          <TextField 
          className="mb-3"
          sx={{ minWidth: 550, maxWidth: 550 }}
            id="firmaVersender"
            name="firmaVersender"
            label="Firma*"
            variant="outlined"
            disabled
            value={props.fieldValue.firmaVersender}

            error={
              props.inputMissingError.firmaVersender ||
              props.inputWrongError.firmaVersender
            }
            helperText={
              props.inputMissingError.firmaVersender ? "Pflichtfeld" : null
            }
            onChange={(event) => props.handleFieldChange(event)}
          />
        </MDBCol>
      </MDBRow>
      <MDBRow >
        <MDBCol>
          <TextField className="mb-3 me-3"
          sx={{ minWidth: 400, maxWidth: 400 }}
            id="nameVersender"
            name="nameVersender"
            label="Name*"
            variant="outlined"

            //value={props.fieldValue.}

            error={
              props.inputMissingError.nameVersender ||
              props.inputWrongError.nameVersender
            }
            helperText={
              props.inputMissingError.nameVersender ? "Pflichtfeld" : null
            }
            onChange={(event) => props.handleFieldChange(event)}
          />

          <TextField 
          className="mb-3"
          sx={{ minWidth: 400, maxWidth: 400 }}
            id="vornameVersender"
            name="vornameVersender"
            label="Vorname*"
            variant="outlined"

            error={
              props.inputMissingError.vornameVersender ||
              props.inputWrongError.vornameVersender
            }
            helperText={
              props.inputMissingError.vornameVersender ? "Pflichtfeld" : null
            }
            onChange={(event) => props.handleFieldChange(event)}
          />
        </MDBCol>
      </MDBRow>

      <MDBRow>
        <MDBCol>
          <TextField className="mb-3"
          sx={{ minWidth: 600, maxWidth: 600 }}
            id="strasseVersender"
            name="strasseVersender"
            label="Straße u. Hausnummer*"
            value={props.fieldValue.strasseVersender}
            disabled
            variant="outlined"
            error={
              props.inputMissingError.strasseVersender ||
              props.inputWrongError.strasseVersender
            }
            helperText={
              props.inputMissingError.strasseVersender ? "Pflichtfeld" : null
            }
            onChange={(event) => props.handleFieldChange(event)}
          />
        </MDBCol>
      </MDBRow>
      <MDBRow>
        <MDBCol>
          <TextField className="mb-3 me-3"
          sx={{ minWidth: 200, maxWidth: 200 }}
            id="plzVersender"
            name="plzVersender"
            label="Postleitzahl*"
            variant="outlined"
            value={props.fieldValue.plzVersender}
            disabled
            error={
              props.inputMissingError.plzVersender ||
              props.inputWrongError.plzVersender
            }
            helperText={
              props.inputMissingError.plzVersender
                ? "Pflichtfeld"
                : props.inputWrongError.plzVersender
                ? "Zahl eingeben"
                : null
            }
            onChange={(event) => props.handleNumberFieldChange(event)}
          />

          <TextField 
          className="mb-3"
          sx={{ minWidth: 600, maxWidth: 900 }}
            id="ortVersender"
            name="ortVersender"
            label="Ort*"
            variant="outlined"
            disabled
            value={props.fieldValue.ortVersender}
            disabled
            error={
              props.inputMissingError.ortVersender ||
